SELECT OUT_GL_DELTASNAPSHOT.BATCHNUM, OUT_GL_DELTASNAPSHOT.CYCLEDATE, OUT_GL_DELTASNAPSHOT.PROCESSINGUNITNAME, NVL(FAOB.FA_BUSINESSUNITMAP,NVL(OUT_GL_DELTASNAPSHOT.BUSINESSUNITMAP,0)) as BUSINESSUNITMAP --NVL(OUT_GL_DELTASNAPSHOT.BUSINESSUNITMAP,0) as BUSINESSUNITMAP, NVL(FAOB.FA_Agent, OUT_GL_DELTASNAPSHOT.AGENTCODE) AS AGENTCODE --OUT_GL_DELTASNAPSHOT.AGENTCODE, OUT_GL_DELTASNAPSHOT.AGENCYCODE, OUT_GL_DELTASNAPSHOT.EARNINGGROUPID, case when FAOB.FA_Agent is not null then substr(OUT_GL_DELTASNAPSHOT.ACCOUNTCODE,1,length(OUT_GL_DELTASNAPSHOT.ACCOUNTCODE)-4)||'S00'||substr(OUT_GL_DELTASNAPSHOT.ACCOUNTCODE,-1,1) else OUT_GL_DELTASNAPSHOT.ACCOUNTCODE end ACCOUNTCODE --OUT_GL_DELTASNAPSHOT.ACCOUNTCODE, OUT_GL_DELTASNAPSHOT.AMOUNT, OUT_GL_DELTASNAPSHOT.CURRENCY, CT.TXT_KEY_VALUE CYCLE_TYPE FROM OUT_GL_DELTASNAPSHOT inner join IN_ETL_CONTROL CT on CT.TXT_KEY_STRING = '$$STR_ACCT_CYCLE_TYPE' AND CT.TXT_FILE_NAME = OUT_GL_DELTASNAPSHOT.PROCESSINGUNITNAME inner join IN_ETL_CONTROL CD on CD.TXT_KEY_STRING = 'OPER_CYCLE_DATE' AND CD.TXT_FILE_NAME = 'GLOBAL' AND OUT_GL_DELTASNAPSHOT.CYCLEDATE = TO_DATE(CD.TXT_KEY_VALUE, 'YYYY-MM-DD') --add agent from AIAS TRANSFER TO AFA BY MAS320 project LEFT JOIN VW_AGENT_AIAS_TRANSFER_TO_AFA FAOB ON OUT_GL_DELTASNAPSHOT.AGENTCODE = FAOB.AIAS_Agent WHERE OUT_GL_DELTASNAPSHOT.PROCESSINGUNITNAME = '$$STR_PROCESSING_UNIT' AND OUT_GL_DELTASNAPSHOT.BATCHNUM in( select max(B.BATCHNUM) from OUT_GL_BATCH B , IN_ETL_CONTROL L where B.CYCLEDATE = OUT_GL_DELTASNAPSHOT.CYCLEDATE AND STATUS='COMPLETED' AND processingunitname ='$$STR_PROCESSING_UNIT' AND L.TXT_KEY_STRING = '$$STR_MAX_CYCLE_DATE' AND L.TXT_FILE_NAME = '$$STR_PROCESSING_UNIT' AND (B.ISLATEST ='Y' OR NVL(L.DEC_ENFORCE_FLG, 0)=1) )
